import "./App.css";
import { FaKey } from "react-icons/fa";

function App() {
  return (
    <div className="w-[570px] h-[350px] bg-[#1A2226] mx-auto mt-[15%] jus">
      <div>
        <svg width="0" height="0">
          <defs>
            <linearGradient id="gradient1" x1="0%" y1="0%" x2="100%" y2="0%">
              <stop
                offset="0%"
                style={{ stopColor: "#27EF9F", stopOpacity: 1 }}
              />
              <stop
                offset="100%"
                style={{ stopColor: "#0DB8DE", stopOpacity: 1 }}
              />
            </linearGradient>
          </defs>
        </svg>
        <FaKey className="text-[80px]" style={{ fill: "url(#gradient1)" }} />
        <div className="text-[#ECF0F5] font-semibold text-[30px] tracking-[2px]">
          ADMIN PANEL
        </div>
      </div>
      <div></div>
      <div></div>
    </div>
  );
}

export default App;
